import 'bootstrap/dist/css/bootstrap.min.css';
import logo from './logo.png';
import "./styles.scss";


export default function Navbar() {
    document.querySelectorAll('[data-component="menu"]').forEach(item => {
        item.addEventListener('click', () => {

          document.title = item.innerHTML;

          resetMenu();

          if (item.hasAttribute('data-menu-item')) {
            let dataMenuItem = item.getAttribute('data-menu-item');

            document.querySelector(`[data-menu-group="${dataMenuItem}"]`).classList.remove('btn-outline-dark');
            document.querySelector(`[data-menu-group="${dataMenuItem}"]`).classList.add('btn-dark');
          } else {
            item.classList.remove('btn-outline-dark');
            item.classList.add('btn-dark');
          }

          let action = item.getAttribute('data-action');


        });
      });

      function resetMenu() {
        document.querySelectorAll('[data-component="menu"]').forEach(item => {
          item.classList.remove('btn-dark');
          item.classList.add('btn-outline-dark');
        });

        document.querySelectorAll('[data-bs-toggle="dropdown"]').forEach(item => {
          item.classList.remove('btn-dark');
          item.classList.add('btn-outline-dark');
        });
      }

    return (
        <div className="row container">
            <div className="col-2">
                <img src={logo} width="150px" className="text-left" alt="logo mercado todo dia" />
            </div>
                 <div className="btn-group col-10">
                    <button data-component="menu" data-action="dashboard" className="btn btn-outline-dark">Dashboard</button>

                    <button type="button" data-menu-group="vehicles" className="btn btn-outline-dark dropdown-toggle" data-bs-toggle="dropdown" aria-expanded="false">
                        Veiculos
                    </button>
                    <ul className="dropdown-menu">
                        <li><a data-component="menu" data-menu-item="vehicles" data-action="addVehicle" className="dropdown-item">Novo</a></li>
                        <li><a data-component="menu" data-menu-item="vehicles" data-action="listVehicles" className="dropdown-item">Listar</a></li>
                    </ul>

                    <button type="button" data-menu-group="clients" className="btn btn-outline-dark dropdown-toggle" data-bs-toggle="dropdown" aria-expanded="false">
                        Clientes
                    </button>
                    <ul className="dropdown-menu">
                        <li><a data-component="menu" data-menu-item="clients" data-action="addClient" className="dropdown-item">Novo</a></li>
                        <li><a data-component="menu" data-menu-item="clients" data-action="listClients" className="dropdown-item">Listar</a></li>
                    </ul>

                    <button type="button" data-menu-group="categories" className="btn btn-outline-dark dropdown-toggle" data-bs-toggle="dropdown" aria-expanded="false">
                        Categorias
                    </button>
                    <ul className="dropdown-menu">
                        <li><a data-component="menu" data-menu-item="categories" data-action="addCategory" className="dropdown-item">Nova</a></li>
                        <li><a data-component="menu" data-menu-item="categories" data-action="listCategories" className="dropdown-item">Listar</a></li>
                    </ul>

                    <button type="button" data-menu-group="products" className="btn btn-outline-dark dropdown-toggle" data-bs-toggle="dropdown" aria-expanded="false">
                        Produtos
                    </button>
                    <ul className="dropdown-menu">
                        <li><a data-component="menu" data-menu-item="products" data-action="addProduct" className="dropdown-item">Nova</a></li>
                        <li><a data-component="menu" data-menu-item="products" data-action="listProducts" className="dropdown-item">Listar</a></li>
                    </ul>

                    <button type="button" data-menu-group="deliveryman" className="btn btn-outline-dark dropdown-toggle" data-bs-toggle="dropdown" aria-expanded="false">
                        Entregadores
                    </button>

                    <ul className="dropdown-menu">
                        <li><a data-component="menu" data-menu-item="deliveryman" data-action="addDeliveryman" className="dropdown-item">Nova</a></li>
                        <li><a data-component="menu" data-menu-item="deliveryman" data-action="listDeliveryman" className="dropdown-item">Listar</a></li>
                    </ul>
                </div>
            </div>
    )
  };
